<script>
	import {
		getMiniUpdateManager
	} from "./utils/wxApi.js"
	import _logger from "@/utils/log";
	import MessManager from "@/utils/messManager";
	import QQMapWx from '@/common/qqmap-wx-jssdk.js';
	import { apiRefreshLocation } from '@/api/guiId.js'
	var qqMapSdk;
	export default {
		data() {
			return {}
		},
		onShow(options) {},
		onHide() {},
		async onLaunch(options) {
			console.log('options', options)
			getMiniUpdateManager();
			this.initResources();
			this.initMapSdk();
			
			this.getUserInfoFunc();
			this.getUserPermissionsFunc();
			this.getSystemFunc();
			let isSightseerStorage = "0";
			
			isSightseerStorage = uni.getStorageSync("isSightseerStorage") || "1";
			console.log('isSightseerStorage', isSightseerStorage)
			this.$store.commit("setIsSightseer", isSightseerStorage);
			this.$store.commit("setMessageSubscribe", false);
			
			
			uni.$off("APP_LOCALTION_REFRESH");
			uni.$on("APP_LOCALTION_REFRESH", (res) => {
				console.log('APP_LOCALTION_REFRESH_res', res)
				if(!!this.$store.getters.openid) {
					this.locationReverseGeocoder(res);
					this.refreshUserLocation(res);
					uni.$emit("PAGE_QRCODE_REFRESH");
				}
			})
			
			uni.$off("APP_GET_LOCALTION");
			uni.$on("APP_GET_LOCALTION", () => {
				console.log('登录成功，获取地址')
				this.getAddress();
			})
			if(!!this.$store.getters.openid) {
				this.getAddress(1);
			}
		},
		onError(err) {
			console.log('onError', err)
		},
		methods: {
			// 初始化资源
			initResources() {
				// 初始化日志(存在就不用新建)
				if(!global._logger) {
					global._logger = new _logger();
					global._logger.init();
				}
			},
			async getUserLogin() {
				const userInfo = uni.getStorageSync("userInfo")
				// 判断缓存是否有用户信息，没有的话，则默认当前用户未打开过小程序，或者打开过后面将小程序删除
				if(!!userInfo) return
				
				try{
					global._logger.writeLogs("没有缓存，执行静默登录")
					// 没有缓存，执行静默登录
					await defaultLogin(false)
				} catch(err) {
					// this.$store.commit("setWxLogin302", false)
					console.log('首页静默登录失败_err', err)
					return;
				}
			},
			// 获取用户信息
			getUserInfoFunc() {
				// 从本地数据里面获取信息
				const userInfo = uni.getStorageSync("userInfo")
				if(!!userInfo && !!userInfo.user_id) {
					this.$store.commit("setUserInfo", userInfo);
				}
			},
			// 获取用户授权信息
			getUserPermissionsFunc() {
				// 从本地数据里面获取信息
				const userPermissions = uni.getStorageSync("userPermissions")
				if(!!userPermissions) {
					this.$store.commit("setUserPermissions", userPermissions);
				}
			},
			// 获取系统信息
			getSystemFunc() {
				// 获取系统信息(每次获取,可能更换设备)
				const newSystem = uni.getSystemInfoSync();
				let isIosX = false
				if (newSystem.platform === "ios" || newSystem.platform === "devtools") {
					isIosX = newSystem.screenWidth >= 375 && newSystem.screenHeight >= 812;
				}
				// 判断是否长屏手机
				const rate = newSystem.windowHeight / newSystem.windowWidth;
				let limit = newSystem.windowHeight == newSystem.screenHeight ? 1.8 : 1.65; // 临界判断值
				const systemInfo = {
					screenWidth: newSystem.screenWidth, // 屏幕宽度，单位px
					screenHeight: newSystem.screenHeight, // 屏幕高度，单位px
					windowWidth: newSystem.windowWidth, // 可使用窗口宽度，单位px
					windowHeight: newSystem.windowHeight, // 可使用窗口高度，单位px	
					platform: newSystem.platform, // 客户端平台
					SDKVersion: newSystem.SDKVersion, 
					model: newSystem.model, 
					version: newSystem.version, // 客户端版本号
					system: newSystem.system, 	// 操作系统版本
					isIosX: isIosX,	// 是否为iPhoneX
					isBigScreen: rate > limit ? true : false // 是否长屏手机
				}	
				let isIos = this.$store.getters.isIos // 是否为ios系统
				// 系统信息修改，重新缓存系统信息
				if(!this.$store.getters.systemInfo.model || this.$store.getters.systemInfo.model !== systemInfo.model) {
					this.$store.commit("setSystemInfo", systemInfo)
				}
				// // #ifdef MP-TOUTIAO
				// 	if(!this.$store.getters.systemInfo.model || this.$store.getters.systemInfo.model !== systemInfo.model || !this.$store.getters.systemInfo.version || !this.$store.getters.systemInfo.system) {
				// 		this.$store.commit("setSystemInfo", systemInfo)
				// 	}
				// 	let isVersion = compareVersion(this.$store.getters.systemInfo.SDKVersion, "1.40.0") > 0 // 大于该基础库版本
				// 	// 获取设备版本号
				// 	let mobileVersion = !!isIos ? this.$store.getters.systemInfo.system.replace(/ /ig, "").replace(/ios/ig, "") : this.$store.getters.systemInfo.system.replace(/ /ig, "").replace(/Android/ig, "");
				// 	// 支付最低版本
				// 	let sysNum = !!isIos ? "9.1.0" : "8.7.0";
				// 	this.$store.getters.systemInfo.canPayVersion = compareVersion(mobileVersion, sysNum) > 0 && isVersion;
				// // #endif
				// 自定义导航栏信息
				let statusBarHeight = newSystem.statusBarHeight; // 状态高度
				let _navAllHeight = 0;
				if(uni.getMenuButtonBoundingClientRect && !!systemInfo ) {
					let menuButtonObject = uni.getMenuButtonBoundingClientRect();
					if(!!menuButtonObject && !!menuButtonObject.height&& !!statusBarHeight) {
						global.navAllHeight = statusBarHeight + menuButtonObject.height + (menuButtonObject.top - statusBarHeight) * 2;	// 导航占据高度
						global.navTitleHeight = menuButtonObject.height + (menuButtonObject.top - statusBarHeight) * 2;					// 导航标题高度
						global.navTitleTop = newSystem.statusBarHeight;		// 导航标题上边距
					} else {
						this.defaultNavFunc(systemInfo, statusBarHeight, isIos);
					}
				} else {
					this.defaultNavFunc(systemInfo, statusBarHeight, isIos);
				}
				// rpx单位同情况下数值
				global.navAllHeightRpx = this.rpxFormatFunc(global.navAllHeight, newSystem.windowWidth);
				global.navTitleHeightRpx = this.rpxFormatFunc(global.navTitleHeight, newSystem.windowWidth);
				global.navTitleTopRpx = this.rpxFormatFunc(global.navTitleTop, newSystem.windowWidth);
			},
			// rpx格式转换
			rpxFormatFunc(lastVal, allVal) {
				return (lastVal / allVal * 750);
			},
			// 默认导航栏数据
			defaultNavFunc(systemInfo, statusBarHeight, isIos) {
				let gap = ""; //胶囊按钮上下间距 使导航内容居中
				if (systemInfo.platform === "android") {
					gap = 8;
				} else if (systemInfo.platform === "devtools") {
					//开发工具中ios手机 5.5 其他 7.5
					gap = isIos ? 5.5 : 7.5;
				} else {
					gap = 4;
				}
				global.navAllHeight = statusBarHeight + 32 + gap * 2;	// 导航占据高度
				global.navTitleHeight = 32 + gap * 2;					// 导航标题高度
				global.navTitleTop = statusBarHeight;	
			},
			getAddress(type) {
				let that = this
				wx.getLocation({
					type: 'gcj02', //返回可以用于 wx.openLocation 的经纬度
					success (res) {
						console.log('res', res)
						that.$store.commit("setUserLocationInfo", {
							latitude: res.latitude,
							longitude: res.longitude
						});
						that.$store.commit("setUserPermissionsKey", {
							key: 'locationInfo',
							val: 1
						});
						if(!type) {							
							uni.showToast({
								icon: "none",
								title: "授权成功",
								duration: 2000
							})
						}
						// that.testJumpAddress(res)
						that.locationReverseGeocoder(res)
						that.refreshUserLocation(res)
						uni.$emit("PAGE_QRCODE_REFRESH");
					},
					fail (err) {
						console.log('err', err)
						if(err.errMsg.indexOf('system permission denied') != -1) {
							uni.showToast({
								icon: "none",
								// title: "系统授权未开启",
								title: "微信位置授权未开启\r\n请前往手机设置开启",
								duration: 2000
							})
						} else if(err.errMsg == 'getLocation:fail auth deny') {
							// uni.showToast({
							// 	icon: "none",
							// 	title: "取消授权",
							// 	duration: 2000
							// })
							// that.getSetting()
						} else {							
							uni.showToast({
								icon: "none",
								title: "授权失败",
								duration: 2000
							})
						}
						// 未授权成功时，使用居住地址进行解析，判断是否为深圳市内
						that.locationGeocoder()
						that.$store.commit("setUserPermissionsKey", {
							key: 'locationInfo',
							val: -1
						});
					},
				})
			},
			initMapSdk() {
				this.$store.dispatch("initMapSdk")
			},
			async refreshUserLocation(info) {
				await apiRefreshLocation({
					lat: info.latitude,
					lng: info.longitude,
				})
			},
			testJumpAddress(info) {
				wx.openLocation({
					 latitude: info.latitude,
					 longitude: info.longitude,
					 scale: 18
				})
			},
			async locationReverseGeocoder(info) {
				console.log('逆地址解析', info)
				let data = await this.$store.dispatch("MapReverseGeocoder", info)
				console.log('逆地址解析结果', data)
				let that = this
				if(!!data) {
					let ad_info = data.result.ad_info
					if(!!ad_info) {
						// uni.showToast({
						// 	icon: "none",
						// 	title: `${ad_info.district}`,
						// 	duration: 2000
						// })
						if(ad_info.city_code == "156440300") { // 深圳市内
							that.$store.commit("setUserLocationType", ad_info.adcode); // 各区区划代码
						} else {
							that.$store.commit("setUserLocationType", 0); // 深圳市外
						}
					} else {
						uni.showToast({
							icon: "none",
							title: '解析异常',
							duration: 2000
						})
						that.$store.commit("setUserLocationType", -1); // 解析异常
					}
				}
			},
			async locationGeocoder() {
				// let address = '广东省 深圳市 大鹏新区 深圳市大鹏新区大鹏办事处勤政路2—1号、好阳光国旅'
				// 数据库一些旧数据存在异常
				console.log('地址解析', this.$store.state.user.home_address)
				if(!!this.$store.state.user.home_address) {					
					let data = await this.$store.dispatch("MapGeocoder", {
						address: this.$store.state.user.home_address
					})
					console.log('地址解析结果', data)
					if(!!data) {
						this.$store.commit("setUserLocationInfo", {
							latitude: data.result.location.lat,
							longitude: data.result.location.lng
						});
					}
				}
			}
		}
	}
</script>

